import React from "react";
import { Col, Row, Container, Card } from "react-bootstrap";
import Emblem2 from '../assets/Emblem2.png';
import Logo2 from '../assets/Logo2.png';
import '../styles/gradient.css'
import '../styles/text-styles.css'
import '../styles/utility-styles.css'

const Login = () => {
    return (
        <Container fluid style={{width:'100vw', paddingLeft:'0', paddingRight:'0'}}>
            <Row xs={1}>
                <Col className="col-md-6 col-lg-6">
                    <div className="gradient" style={{height:'46.9vw'}}> 
                        <img src={Emblem2} alt="Национальная эмблема" style={{ marginLeft: '20px'}}/>
                        <img src={Logo2} alt="Логотип" style={{paddingLeft: '20px'}}/>
                    </div>
                </Col>
                <Col className="col-md-6 col-lg-6">
                    dropdow
                </Col>
            </Row>
        </Container>
    );
};

export default Login;
